    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x658c3437).is_sign_positive());
    assert_eq!(Decimal::<u32, NearestRoundingContext>::from_bits(0x78000000).classify(), FpCategory::Infinite);
