    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x780fffff).is_sign_positive());
    assert_eq!(Decimal::<u32, NearestRoundingContext>::from_bits(0x78f00000).classify(), FpCategory::Infinite);
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x78f00000).is_sign_positive());
