    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7c0f4240).is_snan());
    assert_eq!(Decimal::<u32, NearestRoundingContext>::from_bits(0x7c0fffff).classify(), FpCategory::Nan);
