#[test]
#[rustfmt::skip]
fn bid32_isFinite() {
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x00000001).is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x00080001).is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("-1.0", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("1.0", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("-1.0e-96", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("1.0e-96", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x6098967f).is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x60989680).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7c000000).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7c8f423f).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7c8f4240).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7e100000).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7e100100).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7e8f423f).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0x7e8f4240).is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::from_bits(0x80000001).is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("-9.999999e-95", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("9.999999e-95", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("-9.999999e96", Rounding::Nearest).unwrap().is_finite());
    assert!(Decimal::<u32, NearestRoundingContext>::parse_rounding("9.999999e96", Rounding::Nearest).unwrap().is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0xfc100000).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0xfc100100).is_finite());
    assert!(!Decimal::<u32, NearestRoundingContext>::from_bits(0xfe000000).is_finite());
}

