    assert_eq!(Decimal::<u64, NearestRoundingContext>::parse_rounding("-0", Rounding::Nearest).unwrap().classify(), FpCategory::Zero);
    assert!(Decimal::<u64, NearestRoundingContext>::parse_rounding("-0", Rounding::Nearest).unwrap().is_sign_negative());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::parse_rounding("0", Rounding::Nearest).unwrap().classify(), FpCategory::Zero);
    assert!(Decimal::<u64, NearestRoundingContext>::parse_rounding("0", Rounding::Nearest).unwrap().is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x069a36c8f9c09818).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x069a36c8f9c09818).is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x1000000000000000).classify(), FpCategory::Zero);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x1000000000000000).is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x18ebf0eb84027607).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x18ebf0eb84027607).is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x2407f5972ed7b76b).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x2407f5972ed7b76b).is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x3e2a85a98df1a62e).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x3e2a85a98df1a62e).is_sign_positive());
