    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x72bb05ed5f217403).is_sign_positive());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x73dc9f0cefef8aef).classify(), FpCategory::Zero);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x73dc9f0cefef8aef).is_sign_positive());
