    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x8c32d9f830270c43).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x8c32d9f830270c43).is_sign_negative());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0x97c4180a6666476d).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0x97c4180a6666476d).is_sign_negative());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0xa5247757cbba3ba7).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0xa5247757cbba3ba7).is_sign_negative());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0xb61b100697ed86c3).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0xb61b100697ed86c3).is_sign_negative());
    assert_eq!(Decimal::<u64, NearestRoundingContext>::from_bits(0xb6ee2fa4068519a5).classify(), FpCategory::Normal);
    assert!(Decimal::<u64, NearestRoundingContext>::from_bits(0xb6ee2fa4068519a5).is_sign_negative());
